The SidaGROW component of the SeedsGROW programme started in January 2014 and will end in December 2017
It has three objectives
1) Help build an influential, global multi-stakeholder movement focused on addressing and improving the broken food system;
2) To effectively steer relevant stakeholders to improve global level policies and governance regarding climate change and its impact on food security, land use rights of local communities, and reduction of negative impacts of biofuels on food security;
3) To effectively steer all rel¬evant stakeholders to improve national level policies and governance and in¬terlinked global policies and governance to address the resilience, livelihood needs and rights of those suffering most from the inequitable food system. Focal countries in thisregard are Cambodia, Niger, and Vietnam. Sida GROW also provides technical support for another number of national GROW campaigns for linking them to global policies.
